import React, { createContext } from "react";
import styled from "styled-components";
import Main from "./components/Main";
import Member from "./components/Member";
import ContextProvider from "./Context";
const initMember = [
  {
    id: "Member",
    name: "조인혁",
    img: "../image/inhyeok.png",
  },
  {
    id: "Member",
    name: "김미성",
  },
  {
    id: "Member",
    name: "김초희",
  },
  {
    id: "Member",
    name: "신성일",
  },
  {
    id: "Member",
    name: "오예진",
  },
  {
    id: "Member",
    name: "마경미",
  },
  {
    id: "president",
    name: "김건훈",
  },
];
function App() {
  return (
    <ContextProvider>
      <Main />
      <Member />
    </ContextProvider>
  );
}

export default App;
